import './Recipe.css'; 

class Recipe extends React.Component {
    render() {
    return(
        <div className="tile"> 
            <img className="image" src={"https://spoonacular.com/recipeImages/"+props.recipeID+"-480x360"+"."+props.format}/>
            <p className="title" >  {props.recipeName} </p>  
        </div>
    )
    }
}

export default Recipe;
